import React from "react";

const Generate = () => {
  return (
    <>
      <div className="howto">
        <h1>How to make AI images</h1>
        <form>
          <input type="text" />
          <button type="submit"></button>
        </form>
      </div>
    </>
  );
};

export default Generate;
